Veel genummerde stukken ontbreken. Dit kan de volgende oorzaken hebben: 


reguliere vernietiging, hetgeen blijkt uit aantekeningen in index of agenda;


‘doorschuiven’ naar stukken van jongere datum, hetgeen vooral na februari 1919 regel is geworden;


overbrenging naar andere archieven van Binnenlandse Zaken, met name Binnenlandse Bestuur, hetgeen blijkt uit de zgn. lichtbriefjes;


zoekraken als gevolg van het lichten van stukken zonder verwijzingen.
